import React, { useState } from 'react';
import './index.css';

function App() {
  const [formData, setFormData] = useState({
    firstName: '',
    lastName: '',
    email: '',
    guess: '',
    code: '',
    phoneNumber: '',
  });

  const [error, setError] = useState(false);

  const handleChange = (e) => {
    const { name, value } = e.target;

    let formattedValue = value;

    // Format phone number as 000-000-0000
    if (name === 'phoneNumber') {
      formattedValue = value
        .replace(/\D/g, '')
        .slice(0, 10)
        .replace(/(\d{3})(\d{3})(\d{0,4})/, (_, p1, p2, p3) => {
          return p3 ? `${p1}-${p2}-${p3}` : `${p1}-${p2}`;
        });
    }

    // Format code as 0000-0000-0000-0000
    if (name === 'code') {
      formattedValue = value
        .replace(/\D/g, '')
        .slice(0, 16)
        .replace(/(\d{4})(\d{4})(\d{4})(\d{0,4})/, (_, p1, p2, p3, p4) => {
          return p4 ? `${p1}-${p2}-${p3}-${p4}` : `${p1}-${p2}-${p3}`;
        });
    }

    setFormData({ ...formData, [name]: formattedValue });
  };

  const handleSubmit = (e) => {
    e.preventDefault();

    const isValid = Object.values(formData).every((value) => value.trim() !== '');

    if (!isValid) {
      setError(true);
      return;
    }

    console.log('Submitted Form Data:', formData);
    setError(false);
    alert('Form submitted!');
  };

  return (
    <div className="min-h-screen bg-black text-white flex items-center justify-center px-4">
      <form
        onSubmit={handleSubmit}
        className="bg-[#1a1a1a] p-8 rounded-xl shadow-xl w-full max-w-lg space-y-6"
      >
        <h2 className="text-2xl md:text-3xl font-bold text-center text-[#3CA9B2]">
          Spidr Air Fryer Interest Form
        </h2>

        <div>
          <label>First Name</label>
          <input
            className="input"
            name="firstName"
            value={formData.firstName}
            onChange={handleChange}
          />
        </div>

        <div>
          <label>Last Name</label>
          <input
            className="input"
            name="lastName"
            value={formData.lastName}
            onChange={handleChange}
          />
        </div>

        <div>
          <label>Email Address</label>
          <input
            className="input"
            type="email"
            name="email"
            value={formData.email}
            onChange={handleChange}
          />
        </div>

        <div>
          <label>Guess the Air Fryerâ€™s Cost ($)</label>
          <input
            className="input"
            type="number"
            name="guess"
            value={formData.guess}
            onChange={handleChange}
          />
        </div>

        <div>
          <label>16-Digit Code</label>
          <input
            className="input"
            name="code"
            value={formData.code}
            onChange={handleChange}
            placeholder="####-####-####-####"
          />
        </div>

        <div>
          <label>Phone Number</label>
          <input
            className="input"
            name="phoneNumber"
            value={formData.phoneNumber}
            onChange={handleChange}
            placeholder="###-###-####"
          />
        </div>

        <button
          type="submit"
          className="w-full py-3 text-lg font-bold rounded-md bg-[#3CA9B2] hover:bg-[#32909B] transition"
        >
          Submit
        </button>
      </form>

      {error && (
        <div className="error-modal">
          <p>Please fix the highlighted fields.</p>
          <button onClick={() => setError(false)}>Close</button>
        </div>
      )}
    </div>
  );
}

export default App;
